  input: '"TEXT","F3XN","C00165688","Please note that there are expenses disclosed
    on Schedule B for Line 21b for which this employee did not meet the definition
    of Federal Election Activity.    Please note that there were no disbursements
    disclosed on Line 30 because we have not made any disbursements for federal election
    activity nor did we have any employee who spent more than 25% of their time in
    connection with a federal election and/or federal election activity.    ASDC Dollars
    for Democrats, ASDC Partnership Program, and the State Party Democratic Victory
    Fund are joint fundraising programs in which the North Carolina Democratic Party
    participates.   Transfers are made to the NCDP on an as-needed basis.  Please
    note that state party committees have been reporting Memo Entries on Schedule
    A for contributions received by the joint fundraising program during the reporting
    period in which the contribution was received irrespective of whether transfers
    have been made.  Memo Entries on Schedule A from these programs reflect the gross
    amounts raised while the transfers to the NCDP reflect the net amount distributed
    to date.  Accordingly, there will always be a difference between the transfer
    and the Memo Schedule A totals.  By prior agreement between the NCDPs counsel
    and the FEC, Memo Schedule As for these programs are reported on a quarterly basis.    Any
    disbursements made to Mark Hufford, Joyce Mitchell, and/or Kristen Ward for Telephone
    are reimbursements to them for the business use of their personal cellular telephones.    The
    NCDP owns its headquarters building.  Accordingly, no payments are disclosed for
    office rental."'
